(1, '              We\'re <span style=\"color:#c70000\">D</span><span>igito</span><span style=\"color:#c70000\">W</span><span>ork</span>, the new generation IT digital services provider for the digital transformation work for the new World. ', '           Digitowork, delivers as a \r\n                            				responsible partner for our customers, enabling digital transformation in a way that is inclusive, transparent, fast,\r\n                            				lean & agile. Customer centricity is foundational to Digitowork. Our mission is to support our clients achieve their business objectives by providing innovative, best-in-class IT solutions and services. Our core reference digital architectures and tools, speed and innovation with domain expertise and specialization are keys to building strong relationships with global clients. Our Customer-centricity defines that how we do engage with you, offering specialized services and solutions that meet the distinct needs of your business.', '               WE NURTURE A CULTURE WITH A PASSION TO REFRESH THE WORLD. WE MAKE A DIFFERENCE.', '            ', '               In this 21st century,Digitowork with his great expertise is the power house of passion and perseverance. Our <span style=\"color:#c70000\">GRIT</span> defines our core competencies in the field of IT services, which are:\r\n</p>\r\n<p><span style=\"color:#c70000\">G</span><span>weithredu </span>(Execution) A Welsh word <span>Gweithredu</span> means <span>Execution</span>, which is one of our Core Competencies. \r\nIf the <span>strategy</span> is deciding what to do, <span>execution</span> is all about making it happen. Prioritizing culture of execution for us is similar to our \r\nbusiness strategy, which is a living, evolving entity. Our routines are revisit; reanalyze and make updates are based on how things are moving in real-time, which helps us achieve our set results. ', '           ', '             <span style=\"color:#c70000\">R</span><span>ectitude</span> - <span style=\"color:#c70000\">I</span><span>ntegrity</span> is our strong moral code. We strictly adhere to \r\nour moral code, which reflects transparency, honesty and complete harmony in what we think, say and do. We believe and follow-delivering quality services, \r\nbuilding strong relationships with our clients that are based on honesty and mutual respect which gives our business a competitive edge.', '            <span style=\"color:#c70000;\">I</span><span>nnovation</span> -  At Digitowork we always welcome and encourage a culture of innovation and make way for creative thinking. For us <span>Innovation</span> means creating more effective processes, dynamic products, implementing new ideas and improving services. Resulting enhanced productivity and performance.', '               <span style=\"color:#c70000\">T</span><span>ransboundary</span> - The world is more interconnected than ever before, and only shows signs of becoming more so as time moves on. \r\nExploring global markets gives DigitoWork an opportunity to expand our potential. We have the depth of knowledge, experience and resources across the IT and digital landscape to cater you with our all capabilities under one roof.', '1j.jfif');

