INSERT INTO `advisory_services` (`id`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `image1`, `image2`) VALUES
(1, '         	<h3 style=\"text-align:center\">Advisory Services</h3>\r\n                            	<h5 style=\"text-align:center\">ASK to Task and Track @<span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span></h5>\r\n                              ', '             <p>Businesses, organizations and governments face a complex and ever-changing global environment which requires them to \r\n                                     continuously change and transform themselves in order to remain competitive and relevant. Our advisory practice-ASK, is the partner of choice to assist global and local clients and governments to design, manage and execute lasting change, based on trusted relationships, deep industry knowledge, cutting edge digital technology and professional experience and expertise.\r\n</p>\r\n                                   <p>Our service offerings are designed to reflect client priorities. <span>ASK</span> aims at helping our clients to transform their businesses by \r\n                                   working with them whenever transactions are being contemplated or are in process. <span>ASK</span> provides clients with joined up services across\r\n                                   he idea and execution and delivery continuum from validating the idea for business growth, assessing options, executing projects thus \r\n                                   realizing value from <span>ASK.</span>  DigitoWork has service offerings focused around key client processes that help design, manage accelerate, \r\n                                   elevate and execute lasting change throughout the business life cycle leveraging digital technologies.\r\n</p>\r\n                                    <br/>', '         Advisory services are the keys to unlock your success!', '         <p>Advisory services are a huge need for every business organization out there. No matter you are a corporate giant or a just born start-up, you need advisory services at every step towards your success.\r\n</p>\r\n<p>We\'ve listed up some major factors that show how advisory services can help your organization to perform next level:\r\n</p>\r\n         ', '            \r\n                       <ul class=\"list-style-four\">\r\n    <li><span>Improve customer experience -</span> Create smarter customer experiences that earn loyalty and trust. We believe and follow that great customer experiences only happen when employees are empowered to create and deliver them.\r\n</li>\r\n    <li><span>Reduce Cost - do more with less -</span> If your organization\'s profits were good but are suddenly facing downfall, its good time to get assistance from DigitoWork advisories. We will re-imagine your business structure and with our strong ideation help you to manage and organize strategies to thrust your business like never before.\r\n</li>\r\n    <li><span>Compliance -</span> At DigitoWork we maintain and provide systematic proof of both adherence to internal policies and the external laws, guidelines, or regulations\r\n</li>\r\n    <li><span>Technology-driven Solutions-</span> Technologies are revolutionizing every sector with its fast pace of evolution. Some businesses fail to take the advantages of \r\n    technology and start losing their customers to others, who are more technologically advanced. DigitoWork  not only help you to cope with road map for digital \r\n    transformation but also muster you for  technological advancements by delivering successfully digital transformation of projects. \r\n</li>\r\n  \r\n   \r\n</ul>', '           <p>No matter how big you are, public or private, and in what industries or sectors you do business, we can help you work smarter and reach your goals. Have a look at the services we offer,  and let\'s talk.\r\n</p>\r\n                        \r\n                        \r\n                        <p><span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> Advisory professionals are trusted advisors of the world\'s leading organizations focused on creating and sustaining value for\r\n                        our clients. Our professionals work with senior leadership across functional areas, applying our expertise and deep industry knowledge to\r\n                        develop innovative, technology-driven solutions to solve our clients business challenges and help them grow and achieve financial results.\r\n                        Our Advisory helps organizations navigate a variety of risks to lead in the marketplace and disrupt through innovation. With our insights, \r\n                        you can learn how to embrace complexity, leverage digital technology, and accelerate performance.\r\n</p>\r\n                ', '          <p>We help clients create and sustain value by:</p>', '                                              \r\n<ul class=\"list-style-four\">\r\n    <li>Establishing IT strategies to change, grow, adapt, shape and respond to disruptive forces</li>\r\n    <li>Turning their digital technology vision into reality</li>\r\n    <li>Optimizing their operations and streamlining support functions through digital technologies</li>\r\n    <li>Converting their data into insight</li>\r\n    <li>Mitigate IT Asset Management Risk</li>\r\n   \r\n</ul>', 'adv4.png', 'adv3.png');

