INSERT INTO `itam_services` (`id`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `p14`, `p15`, `p16`, `p17`, `p18`, `p19`, `p20`, `p21`, `p22`, `image1`, `image2`) VALUES
(1, '                                      IT Asset Management', '                                     IT Asset Management is a set of business practices that support IT Asset life cycle management and strategic decision making for the IT environment. IT assets include all software and hardware contained in your organization\'s IT environment. The fact that the IT infrastructure is changing every day is probably undeniable. Every day new users are being added, deleted, or moving and those changes affect the IT assets  hardware and software.', '                                      IT Asset Management (ITAM) at DigitoWork means providing an accurate account of technology asset lifecycle costs and risks to maximize the business value of technology strategy and sourcing decisions. For us IT Asset Management isn\'t just about inventorying assets, it about using the information that is captured to drive strategic and operational decisions. Increasingly, IT organizations are focusing on the usability and informational value of IT asset data to drive business value instead of just focusing on data quality and accuracy. We believe that Stronger IT Asset Management leads to faster roll out of Digital Transformation projects.', '                                      Here are some of the key goals of Asset Management in IT that we do:', '                                      	<li>Enforce compliance with corporate security policies and regulatory requirements</li>\r\n                                                <li>Improve productivity by deploying the technology to support user and business needs</li>\r\n                                                <li>Reduce licensing and support costs by eliminating or reallocating underutilized resources and licenses</li>\r\n                                                <li>Limit overhead costs of managing the IT environment</li>  ', '                                      <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> provides a roadmap for your esteem organization to:', '                                      	<li>Understand your ITAM objectives and build IT asset management requirements and execution strategy.</li>\r\n                                                <li>Quantify the total value of unused hardware and software applications. This helps optimize asset usage and cut down extra maintenance costs.</li>\r\n                                                <li>Assess the adverse impact of aging hardware on IT and avoid unprecedented losses. This helps you make decisions on new asset purchases and dispose or repair aging equipment.</li>\r\n                                                <li>Assess and minimize the IT Risks and Security Vulnerabilities on an ongoing basis.</li> ', '                                      With <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span>, you get these powerful features:', '                                      	<li>Constantly gather scanned data for all IT assets where an employee is deployed, listing installed software, existing vulnerabilities, and hardware details </li>\r\n                                                <li>Actionable information  to detect a variety of issues, such as unauthorized software, outdated or non-existent licenses, or IT policy violations</li>\r\n                                                <li>Perform ad-hoc analysis and refine them using criteria like device location, OS version, CPU, or a particular vulnerability</li>\r\n                                                <li>Compatible with virtualized and cloud environments to track the constant proliferation of virtual images inside and outside your IT environment</li>\r\n											', '                                     We provide complete IT Asset, Compliance & Inventory Tracking solution that enables users to conduct comprehensive, cost-effective physical audits. We take the lead in your IT Asset Recovery and Disposition. We design and execute the recovery for your decommissioned assets  without disrupting your workflow or burdening your staff. For IT Asset Management and disposition to be successful in meeting your goals, we identify your objectives and build a solution around your needs. DigitoWork  works as an extension of your IT Asset Management team to execute and manage your IT asset management and disposition thus making your ITAM program rock solid.', '                                     <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> will:', '                                       <li>Determine your unique needs and priorities. </li>\r\n									 <li>Create a custom IT Asset Management Program to fit your goals and timeline </li>\r\n									 <li>Coordinate the timing, etiquette and recovery requirements with your site representatives.</li>\r\n									 <li>Eliminate the burden on you for identifying and managing multiple vendor relationships. </li>\r\n									 <li>Provide standardized electronic reporting across your global footprint to make Software Harvesting a breeze reclaim unused licenses and return money to your budget.</li>\r\n									 <li>SLA Based Management & Reporting</li>\r\n									 <li>Process Automation and Modernization</li>\r\n									 <li>Alerting and Data Integration </li>\r\n									 <li>Process Simplification</li>\r\n									 <li>Metrics Driven Data Analytics and Decision Making</li>', '                                      <span><span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> executes to continuously detect and protect your IT assets against cyber-attacks, whenever and wherever they occur.</span>', '                                      Benefits of IT Asset Management:-', '                                      Informed Purchasing and Deployment Decisions', '                                      \r\nA key benefit of IT asset management is to understand what IT assets you have and what they are being used for. Consistently maintaining accurate IT asset management data can help an organization evaluate past purchasing and deployment decisions and guide future actions. This includes selecting the best vendors based on not only purchase price but also product/service quality and post-sale support. IT asset management can also help improve software deployment decisions and avoid over-purchase of resources that are not needed.', '                                      Business Continuity', '                                        Disasters and outages happen. IT asset and configuration data can help leaders and staff identify the impacts of outages on\r\n                                            business and more confidently make decisions to restore services to users. Asset data can also be a valuable input to developing IT architectures that are robust and resilient to many situations.', '                                      License and Subscription Compliance', '                                     One of the biggest challenges for modern IT organizations is tracking software licenses and cloud subscriptions. It is difficult for a company to identify IT Assets that they are paying for and not being used. Non-compliance is not only a legal and financial risk for the company but a potentially costly problem to remediate.', '                                      Total Cost of Ownership', '                                         The cost of an IT asset is a lot more than just the purchase price that was paid to acquire it. For IT assets to create value, they must be operated, supported and maintained throughout their lifecycle. TCO is a measure of the overall cost of owning and operating an asset. Managing TCO effectively helps eliminate costs from duplication of assets or not using them after they are purchased.', 'itam.png', 'itsm2.jpg');

