INSERT INTO `itsm_services` (`id`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `p14`, `p15`, `p16`, `p17`, `p18`, `image1`, `image2`, `image3`) VALUES
(1, '                    IT Service Management - <span style=\"font-weight: 300;font-size: 23px;\">That powers your organization</span>', '                    <p>IT Service Management (ITSM) is the craft of implementing, managing, and delivering IT services to meet the needs \r\nof an organization. It ensures that the appropriate mix of people, processes, and technology are in place to provide value.\r\n  \r\n</p>\r\n <p>DigitoWork offers a wide range of ITSM consulting and implementation services for businesses of any size and \r\nindustry.\r\n  We help companies tune their IT processes in line with their business goals and growth needs. We design, plan, deliver, \r\noperate and control information technology (IT) services for our esteemed clients.\r\n </p>\r\n <h6><a>\r\n<span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> - benefits of IT Service Management: </a></h6>\r\n\r\n <ul class=\"list-style-five\">\r\n \r\n<li>Reduce IT costs </li>\r\n <li>Improve the quality of service</li>\r\n <li>Improve customer satisfaction</li>\r\n \r\n<li>Improve governance and reduce risk</li>\r\n <li>Increase competitive advantage</li>\r\n   \r\n <li>Improve flexibility</li>\r\n <li>Increase agility for new IT services</li>\r\n </ul>', '                         <h6><a >Using \r\n<span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><spanstyle=\"color:#222222\">ork</span> ITSM to reduce costs - Our key benefit can help do this by:</a>\r\n </h6>\r\n  <br />\r\n <ul class=\"list-style-five\">\r\n   <li>Increasing IT efficiency</li>\r\n\r\n <li>Increasing business efficiency</li>\r\n     <li>Reducing IT wastage</li>\r\n  </ul>\r\n  <h6>In order to increase IT efficiency, \r\n <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> - IT service management differentiating factors are:\r\n\r\n    </h6>\r\n <br />\r\n     \r\n <ul class=\"list-style-five\">\r\n <li>Process workflow</li>\r\n   <p style=\"margin-left: 26px;\">Offer technology-enabled process workflow and \r\n eliminate manual process, thereby improving collaboration between\r\n        all teams.</p>\r\n   \r\n <li>Efficient use of scarce IT human resources</li>\r\n  <p style=\"margin-left: 26px;\">Reduce admin workload, waiting times, and even eliminate \r\n internal firefighting to make time for more strategic work.</p>\r\n   <li>Service-based incident management</li>\r\n  \r\n <p style=\"margin-left: 26px;\">Prioritize and customize the resolution time based on the business impact caused by IT issues.</p>\r\n      \r\n <li>Save time and money</li>\r\n  <p style=\"margin-left: 26px;\">Effective problem management and knowledge management help reduce recurring issues,\r\n resolution times, and impact on end users and the business as a whole.</p>\r\n <li>Insightful reports</li>\r\n     <p style=\"margin-left: 26px;\">Automate the report-generating process and reduce reporting costs.\r\n     \r\n </p>\r\n      </ul>', '              <h6>To increase business efficiency, <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> IT service management differentiating factors are:\r\n  \r\n </h6>\r\n   <br />\r\n      <ul class=\"list-style-five\">\r\n  <li>Reduce downtime</li>\r\n  <p style=\"margin-left: 26px;\">With the help of incident, problem and availability management.</p>\r\n  \r\n <li>Prevent issues before they occur</li>\r\n   <p style=\"margin-left: 26px;\">Prevent serious, business-affecting issues through problem\r\n management and capacity management.</p>\r\n     <li>Help businesses to quickly bounce back from critical IT issues</li>\r\n   \r\n <p style=\"margin-left: 26px;\">The adverse effect of severe issues can be mitigated through major incident management and IT service continuity.</p>\r\n \r\n   </ul>', '                       <h6><a>Finally, to reduce wastage,\r\n  <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> IT service management can:\r\n </a></h6><br />\r\n    <ul class=\"list-style-four\">\r\n    <li> <span>Improve Efficiency</span> </li>\r\n  \r\n <p style=\"margin-left: 26px;\">Save time, efforts and unnecessary costs by reducing wastage and avoiding duplication of work.</p>\r\n \r\n <li><span>Optimize spending </span></li>\r\n    <p style=\"margin-left: 26px;\">Ensure that any new IT spends is essential through asset,\r\n configuration, and capacity management.</p>\r\n  <li><span>Remove the costs of duplicate or obsolete assets</span></li>\r\n         \r\n <p style=\"margin-left: 26px;\">Effective asset management can help avoid duplicity of applications, hardware, hosting, and their support.</p>\r\n \r\n <li><span>Facilitate the redeployment of underutilized assets </span></li>\r\n <p style=\"margin-left: 26px;\">PCs, other devices, and installed personal productivity software need to be effectively tracked to prevent underutilization.</p>\r\n  \r\n <li><span>Prevent change-related or inconsistency-based wastage</span></li>\r\n <p style=\"margin-left: 26px;\">Avoid the costs of reworking mistakes that is ultimately the duplication, or even triplication, of effort.\r\n         \r\n </p>\r\n  </ul>', '                      With <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span>, you get these powerful features:', '                      Problem Management', '                      <p style=\"font-weight:bold\">Problem management for proactive service management<br>\r\n    Prevent disruptions to the business and deflect tickets through proactive problem management.</p>\r\n\r\n       \r\n <ul class=\"list-style-four\">\r\n   <li>Handle problems with simple automation</li>\r\n <li>Provide visibility with root cause analyses </li>\r\n <li>Drive transparency with known error database </li>\r\n  \r\n <li>Prevent incidents with workarounds and solutions</li>\r\n  </ul>', '                     Change Management', '                     <p style=\"font-weight:bold\">Change management to mitigate risks\r\n \r\n <br>Plan and assess changes with the Change Advisory Board (CAB) before changes are rolled out.</p>\r\n\r\n    <ul class=\"list-style-four\">\r\n  <li>See changes through, from planning to rollout </li>\r\n  <li>Minimize redundancy and manual efforts</li>\r\n  <li>Manage daily tasks with the Change Calendar </li>\r\n  <li>Control approvals on-the-go </li>\r\n   <li>Insights from post-release review</li>\r\n \r\n </ul>\r\n', '                     Release Management', '                     <p style=\"font-weight:bold\">Release management for all your deployments<br>Plan releases by documenting the build and test plans from beginning to end and schedule announcements.</p>\r\n\r\n\r\n                                               <ul class=\"list-style-four\">\r\n                                                   <li>Schedule announcements for visibility </li>\r\n                                                   <li>Reduce risk with integrated modules</li>\r\n                                               </ul>', '                     Configuration Management Database <span>(CMDB) </span>', '                     <p style=\"font-weight:bold\">Maintain a Centralized Repository for All Your Configuration Items<br />\r\n                                                   It is easy and beneficial to walk through the CMDB and get the asset information and the associated changes. Every module in\r\n           <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> is well integrated, be it change, assets, or CMDB.</p>\r\n\r\n\r\n                                               <ul class=\"list-style-four\">\r\n                                                   <li>Gain in-depth Visibility of Your IT Infrastructure, Improve System Reliability </li>\r\n                                                   <li>Know the Connection, Define Configuration Items(CIs) and Map Relationships</li>\r\n                                                   <li>Support Other ITIL Processes, Speed Up Resolution</li>\r\n                                               </ul>', '                     Knowledge', '              <p style=\"font-weight:bold\"> \r\nDigitoWork  is a game changer in turning IT teams from daily fire-fighting to delivering awesome customer service.\r\n                                                   It provides great visibility and central control in dealing with IT issues to ensure that businesses suffer no downtime. </p>\r\n\r\n\r\n\r\n\r\n                                               <ul class=\"list-style-four\">\r\n                                                   <li>Best practice ITSM workflows</li>\r\n                                                   <li>Powerful integrations with IT management apps</li>\r\n                                                   <li>Codeless customizations</li>\r\n\r\n <li>Smart automation</li>\r\n   <li>Extensive reporting capabilities</li>\r\n  </ul>', '                     <h6>HOW OUR IT SERVICE MANAGEMENT CONSULTING WORKS: </h6>', '              <p>There are 4 major ITSM consulting models at DigitoWork : one-time consultation, helping you to choose a platform, implementation services and\r\n ongoing improvements.</p>\r\n  <p><span>1. One-time consultation - </span>You show us your ITSM-related problem  we solve it. For instance:</p>\r\n                                   <ul class=\"list-style-four\">\r\n                                       <li><span>Your company needs to process changes caused by outsourcing or insourcing particular IT services</span></li>\r\n <p style=\"margin-left: 28px;margin-bottom: 6px;\">\r\nDigitoWork  can perform needed integrations between the ITSM solutions of different IT departments, configure your Service Level Management and implement different workflows for different service units.\r\n                                       </p>\r\n                                       <li><span>Your IT support is suffering from a low user satisfaction rate</span></li>\r\n                                       <p style=\"margin-left: 28px;\">Our ITSM consultants can help you enhance users satisfaction by revealing the potential of service portals and Knowledge Management or setting up satisfaction surveys.\r\n                                       </p>\r\n                                   </ul>\r\n\r\n                                   <p><span>2. Choosing a platform - </span>Once you choose to introduce ITIL practices and ITSM approach into your company\'s\r\n  processes, we\'ll help you decide on the right platform to achieve your goals with. At first, we clarify your requirements. After that, we assess a number of platforms and identify the product that will meet your needs and requirements best.\r\n                                   </p>\r\n\r\n                                   <p><span>3. ITSM platform implementation - </span>If you\'ve come as far as adopting a particular ITSM system but you aren\'t satisfied with its out-of-the-box functionality, we can customize it so that it meets your requirements. Here\'s what we do:\r\n                             </p>\r\n\r\n\r\n\r\n\r\n  <ul class=\"list-style-five\">\r\n <li>Clarify your needs and aims,</li>\r\n   <li>Jointly spell out your requirements</li>\r\n <li>Implement your functionality</li>\r\n     <li>Support your system</li>\r\n  </ul>\r\n   <p><span>4. Take your help desk to the next level</span><br />\r\n<span style=\"color:green\">Gain control over your IT system using all the Services DigitoWork  offers</span>\r\n       </p>', 'ITSM (1).jpg', 'ITSM Process.jpg', 'itsm2 (1).png');

