(1, '    5E Framework', '    At DigitoWork-Execution Methodology is a strictly defined combination of logically related practices, methods and processes that determine how best to plan, develop, control and deliver a project throughout the continuous implementation process until successful completion. We believe in a, systematic and disciplined approach to project design, execution and completion.', '    Our 5E framework coupled with our homegrown TASK management tool, has established a sustainable and reliable deliveries to our customers.', '    Here is a quick walk through of the three phases', '   DigitoWork  As a service provider we connect all project activities together and create the harmony in the project. Our team has a detailed understanding on all the project management processes and the tools that they can make use for each project management process are:', '    <span>Engage-Engineer-Execute: </span>The first phase is the <span>Engage</span> phase. This phase involve identifying\r\n                                   solutions and providing recommendation based on the analysis of cost and benefits for each possible solution. We make it\r\n                                   easy for anyone to map processes with their team and analyze improvements. By the end of this phase, a project proposal\r\n                                   will be developed. At Engage Process we aim to keep things simple, so everyone can contribute to driving better efficiency,\r\n                                   quality and growth.', '    <span>Extend-Engineer-Execute: </span>The <span>Extend</span> phase begins with DigitoWork project team who are well experienced in\r\n                                   managing the project. We define the project scope and develop the project charter, which will be approved by approving authority. The signatures formally empower to expend resources on the project and begin the Planning phase of the project. Our significant engineering and technology capabilities have enabled us to develop a technology driven project implementation profile and successfully integrate sophisticated extend, engineering and execute methodologies with strong project management practices.', '    <span>Expand-Engineer-Execute: </span>In the <span>Expand</span> phase, various planning activities will be conducted, which includes the planning of work, schedule, budget, resources, staffing need, and etc. Those planning activities are performed to ensure the project will be completed on time and within budget. We as a team completes the development activities identified to produce the project deliverables required. This phase ends by having all the deliverables on given turnaround time based on Service Level Agreement (SLAs).', 'methodology.jpg', 'slide_1_1.jpg', 'slide_2_1.jpg', 'slide_3_1.jpg');

