INSERT INTO `services` (`id`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `image1`) VALUES
(1, '                   Data Services', '                   As a true global data management leader, DigitoWork  provides\r\n                                            data-driven marketers with the most advanced contact data\r\n                                            quality services available. Our <span>PureData</span> product ensure your data is properly standardized, corrected and validated for\r\n                                            deliverability.\r\n                                        ', '                   Whether your customer, supplier, hardware or software data, we offers the top most data quality services to meet your needs. Through our\r\n                                            leading edge technology expertise, we can help you manage, maintain and process your valuable data. The data helps you ensuring\r\n                                            accuracy, analyze the database in detail. This also ensures databases are optimized to return accurate results when utilized within\r\n                                            data analytics and other business intelligence efforts.', '                   At DigitoWork , we believe that data can make what is impossible today, possible tomorrow. We empower people to transform complex data into clear and actionable insights. The most valuable and transformative business use cases IoT-enabled predictive maintenance, genomics research, real-time compliance monitoring require multiple analytics workloads and data science tools and machine learning algorithms to run against the same diverse data sets. It\'s how the most innovative enterprises unlock value from their data and compete in the data age.\r\n                                    ', '                   <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> provides data visibility and sufficient insights, by: </h6>\r\n                                    ', '                    <ul class=\"list-style-five\">\r\n\r\n                                        <li>Analytic workloads running independently as cloud data warehouses and data science tools are designed to work together.</li>\r\n                                        <br />\r\n                                        <li>Organizations need a new approach. We unlocks the power of your data to serve you better, operate with greater efficiency, and strengthen security to protect your business:</li>\r\n                                    </ul>\r\n                                    <ul class=\"list-style-four\" style=\"margin-left: 28px;margin-top: -20px;padding-bottom: 10px;\">\r\n                                        <li>It is optimized for hybrid and multi-cloud environments, delivering the same data management capabilities across bare metal, private, and public clouds</li>\r\n                                        <li>It allows multiple analytic functions to work together on the same data at its source, eliminating costly and inefficient data silos</li>\r\n                                        <li>It maintains strict enterprise data security, governance, and control across all environments</li>\r\n                                    </ul>', '                   We are\r\n                                        client-driven company with our top priorities placed on attention to detail, quality and performance.\r\n                                        Our basic growth philosophy is one of moderation and is based on <span style=\"color:#c70000\">GRIT</span> with the highest quality of Execution, Innovation and\r\n                                        Integrity with no boundary limits. Our basic operating philosophy is to provide our clients with innovative solutions\r\n                                        to help them grow, while providing the highest degree of customer service possible. We believe that by providing global direct opportunities\r\n                                        to clients, we can help meet your needs to the highest degree', '                   We are committed to developing and or acquiring new technologies that will continuously improve our global capabilities.', '                   Our Workflow', '                <li style=\"font-family: \'Arimo\', sans-serif;\"><span>Consultation - </span>\r\n                                        We pride ourselves on our ability to mould our solutions to meet the unique needs of each client. Whether it\'s an existing or custom solution, we have the expertise to tap the proper set of tools to meet your business need.\r\n</li>                                  <li style=\"font-family: \'Arimo\', sans-serif;\"><span>Data Accessibility - </span> \r\n                                         We offer services, industry-specific Data Management Platforms (DMPs) that provide you with secure online access to your database. Our DMPs are highly customizable and contain technologies for advanced database segmentation, data analytics, reporting and much more.\r\n\r\n</li>                                 <li style=\"font-family: \'Arimo\', sans-serif;\"><span>List Enhancement/ Data Append -</span> We offer B2B Data append solutions to add missing information and intelligence elements onto your database in order to increase business intelligence and segmentation capabilities. \r\n \r\n</li>\r\n                                      <li style=\"font-family: \'Arimo\', sans-serif;\"> <span>Unified Database Creation -</span>  \r\n                                      We specialize in connecting data silos in order to create a true 360 degree customer view that combines, among other things, online and offline source data/elements. Our expertise in combining global multi-sourced data files, regardless of variances in source formatting, into a unified master database, built to meet your exact specifications, is unrivaled in the industry.\r\n\r\n</li>', '               Data Management Services - Key Implementation Outcomes', '               IT\'S NOT JUST THE TECHNOLOGY; IT\'S HOW YOU USE IT.', '               <p><span>1. Creation of a Single Record of Record: </span>Known data is unified into a duplicate-free master database containing a single unique record for each asset with attached cross-organizational intelligence metrics.</p>\r\n                            <p><span>2. Data Analytics & Reporting: </span> The Analytics technology facilitates the full spectrum of business intelligence and \r\n                            data analysis requirements. Users can analyze numerous elements, and SLA metrics in order to gain insights, inform future requirement methodologies and much more.DigitoWork  Analytics technologies also contains an advanced \r\n                            reporting services which includes comprehensive options for additional reporting. Moreover, we regularly work with clients to create custom reports based on specific business needs. Our reporting services offers the ability to create and download both numerical and graphical report renderings, useful for executive presentations.</p>                        \r\n                              <p><span>3. Creation of a 360Âº Customer/IT Assets View:  </span> Ingrained within the usage of any Data Management Platform is the marketers desire to create a \r\n                              true 360Âº view of all cross-organizational data records within a single platform. Leveraging our benchmark Data Management Services,\r\n                              we specialize in breaking down Data Silos and combining multi-sourced databases into a clean, standardized Master Data Warehouse\r\n                              that can be accessed via and fully leveraged by advanced technologies and frameworks.\r\n                            <p><span>4. Custom Data Segment Creation & Exporting:  </span>We make it easy for users to gain data-driven insights that inform marketing campaign decision-making from their database. Users can then easily create and export customized data, with user-determined formatting and element inclusion, to meet any purpose, such as:</p> \r\n                                <ul class=\"list-style-five\">\r\n                                    <li>Data export for internal organizational/departmental data analysis.</li>\r\n                                    <li>Support data exports, reports and analytics for operational initiatives and continuous improvement projects.</li>\r\n                                </ul>', 'data1.png');

