INSERT INTO `service_desk` (`id`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `p14`, `p15`, `image1`) VALUES
(1, '                     Service Desk', '                  A Service Desk is a primary IT function within the discipline of IT service management (ITSM). Keeping up with rising expectations\r\nrequires a modern and intelligent platform that aligns with industry best practices (ITIL) to achieve faster time to value with\r\npowerful workflow and process automation capabilities.DigitoWork ensures this with a modern, mature and intelligent platform.\r\nWe provide a Single Point of Contact (\"SPOC\") to meet the day-to-day communication needs of both users and IT staff,\r\nand also to satisfy both Customer and IT Provider objectives.DigitoWork process is designed to keep operation running smooth through\r\nIT Team.', '                 DigitoWork, an Indian-based Digital Data service provider, can be your right partner for strategic technology advisory services, majorly because of its client-friendly approach in every advisory solution it offers to all firms, irrespective of sector and size.', '                  Our full-service package of Service Desk expertise - Advantage:', '                  <span>Automate with ease - </span>Repetitive tasks and manual processes that your IT team performs can be automated with the simple drag and drop action of workflow automator.', '                  <span>Effective multi-channel support</span> - Record, track and prioritize IT issues with ease and provide support for issues raised via email, self-service portal, phone, chat, or in person.', '                  <span>Move from reactive to proactive ITSM </span>- Your IT team can move from providing reactive ITSM to proactive ITSM with the help of problem management feature by identifying and eliminating recurring issues.', '                  <span><span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> IT service desk software solutions</span>', '                  Implementing the right IT service desk software can make all the difference between a service desk that successfully serves -\r\n                                           and one that doesn\'t. To best position your organizations service desk for success, you ll need a software solution capable of\r\n                                           handling your demanding environments daily workload.', '                  Our service management services are designed to ready your service desk to tackle any issue, incident or implementation. With the\r\nability to manage change requests, asset tracking, help desk requests, and more, we put everything in one powerful package through our services team.', '                  The broad scope required for the modern IT service desk positions it as a principal element in any organizations technology\r\n                                           strategy. Service Desk is a central point of contact for technology use throughout the business, service desks are needed by any organization interacting with technology as part of its operational processes. As such, selecting the right software and focused implementation service will enable your service desk to handle all service desk tasks with greater speed, ease, and satisfaction, with DigitoWork\r\n                                           leading the pack.', '                  <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> - Service Desk offers all the essentials in</span>', '                  <span  style=\"padding-left: 6px;\"> One place to manage all your IT support</span>', '              \r\n   <span> Key benefits and capabilities of the IT Service Desk services:</span>', '                   <li>IT Asset Management - Track hardware, software, and mobile assets. Leverage IT asset management that is included in\r\n                                               DigitoWork Service Desk solution right out-of-the-box.</li>\r\n                                           <li>Analytics - Get the reports, dashboards, and SLAs you need to understand and communicate your IT performance and make better IT and business decisions in minutes.\r\n                                           </li>\r\n                                           <li>Customize Tools - Save time and money using the DigitoWok customize tools to optimize personal and team performance, and to improve service delivery.\r\n                                           </li>\r\n                                           <li>Improve SLA Customer response - How to set, measure and report on SLAs. SLAs (service level agreements) are notoriously difficult to measure, report on, and meet.\r\n                                               However, at  DigitoWork we configure, track every performance against top objectives, and SLAs provide a great opportunity to improve customer satisfaction.\r\n                                           </li>', 'desk2.png');

