INSERT INTO `software_license_management` (`id`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `p14`, `p15`, `p16`, `p17`, `p18`, `image1`, `image2`, `image3`, `image4`) VALUES
(1, '                 Software License Management\r\n', '                 <p>Software license management, or SLM, is part of overall software asset management (SAM) capability and involves the process\r\n                                    of reducing, documenting, and controlling total IT costs. DigitoWork  helps you monitor and maintain all your organization\'s various \r\n                                    software licenses, cost and compliance.\r\n</p>', '               We manage various license types. Few are the following examples of a License types:', '                 \r\n                                       <li><span>Per device or CPU: </span>only intended for a single machine whether it is an end user or data center device</li>\r\n                                       <li><span>Per user:</span> restricted to one specific user who can use it on multiple devices (like their desktop and laptop), requires the user to log in to confirm their identity</li>\r\n                                       <li><span>Per network: </span>covers all machines that are on a single specific network</li>\r\n                                       <li><span>Per subscription:</span> managed by a subscription for user or device, usually has an expiration date</li>\r\n                                       <li><span>General Public License (GPL):</span> covers software that comes with no charge and can be used, shared, copied, and modified for free (freeware)\r\n</li>', '            <span>Database: </span>While often aligned to device, database licensing types demand special consideration due to the high cost and complex licensing constructs that differ by vendor and may include number of servers or cores, running versus installed databases, all you can consume licensing and others. Compliance and true-ups are also complicated by the deployed models that include high availability, fail-over and pluggable databases. \r\nWe keep upgrading our models frequently and staying in tune with the marketplace to ensure ongoing compliance can be time an arduous, ongoing task', '               Benefits of Software License Management', '               A huge advantage that we provide your company to have all software licenses under control is to save money. \r\n                                   By tracking and monitoring all purchases, clients are ensured that each license is accounted for and is being used.\r\n', '                 <p>The biggest benefit of DigitoWork SLM is that we ensure all software products have following compliance with software licenses \r\n                                   (also known as an End-User License Agreement, or <span style=\"color:#286dc3\">EULA</span>). We completely understand that if one device that is using unlicensed software, or is not following specific guidelines set by the EULA, our esteem clients could be in for some hefty fines or even legal trouble.\r\n</p>', '                Software License Management Best Practices and Practical Considerations', '           <p>DigitoWork \r\n                                           ensures that your company does not take unnecessary risks when it comes to managing all your software licenses. Here are some software license management\r\n                                           best practices:\r\n                                       </p>\r\n                                       <ul class=\"list-style-five\">\r\n                                           <li><span>Strong Policies: </span>Create a software management policy that is clear and explicit that helps you to establish clear controls needed to effectively manage your software assets as well as avoid common pitfalls.\r\n                                           </li>\r\n                                           <li><span>Clear Controls: </span>At a minimum, set enforce-able controls regarding software usage within the company and\r\n                                               outline strict guidelines on who is authorized to install or purchase software. A good practice here is to control the front\r\n                                               door through digital storefronts and restrict the ability for users to download or install software. With today\'s handheld\r\n                                               and mobility revolution and end-user app-stores, this becomes more of a risk to the enterprise and your company.\r\n                                           </li>\r\n                                           <li><span>Process and Governance:</span> Establish roles and processes to manage the hardware and software lifecycle. Effectively communicate, implement and manage the software asset policy and enabling processes.</li>\r\n                                           <li><span>Automated Discovery: </span>Regularly discover your hardware and software in all network environments and audit every type of software that is installed on employees desktops. Physical audits should be established in addition to automation. Data quality is an underpinning capability to success.\r\n                                           </li>\r\n                                           <li><span>Asset Management and your CMDB:</span> In addition to discovery, manage the lifecycle of your assets to ensure data quality. Ensure your CMDB and Asset systems contain a robust data model that meets the needs of all your hardware and software assets.\r\n                                           </li>\r\n                                           <li><span>Automated Provisioning and Audits: </span>Perform regular checks and deploy the latest software updates.\r\n                                           </li>\r\n                                           <li><span>Software Refresh: </span>Strong License Management helps in proper software update and upgrade process combined with patch management.\r\n                                           </li>\r\n                                           <li><span>Cloud: </span>Reduce the cost, risk and complexity of server & cloud licenses\r\n                                           </li>\r\n                                           <li><span>Trace-ability:</span> Keep track of how applications are being used and who is using them. Integrate this usage with your on-boarding and off-boarding processes. A good practice here is to ensure your provisioning automation for both end users and the data center not only records the software usage and owners, but also initiates ongoing discovery to enable comparison of your book understanding to a discovered understanding.\r\n                                           </li>\r\n                                           <li><span>Contracts Integration:</span> Utilize or integrate your contractual databases or procurement records to establish a clear understanding of your licenses.\r\n                                               In DigitoWork , be sure to know your license types, quantity, and expiration dates.\r\n                                           </li>\r\n\r\n                                           <li><span>Measure Your Outcome: </span>Set targets and measure progress against license cost saving goals.\r\n                                           </li>\r\n                                       </ul>', '                Software License Management: preventing out of compliance situations', '                 <h6>Top 3 benefits of <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> Software License Management:</h6>\r\n\r\n<ul class=\"list-style-five\">\r\n									    <li>Costs you control</li>\r\n									    <p style=\"margin-left: 28px;\">	Minimize what you spend on licenses, and maximize how you save</p>\r\n									    <li>Automation you need</li>\r\n									    <p style=\"margin-left: 28px;\">	Instantly calculate the licenses you need for servers, virtual servers, and cloud\r\n</p>                       \r\n                                    <li>Compliance you trust</li>\r\n                                    <p style=\"margin-left: 28px;\">	Get accurate analysis that shows how your usage matches your contracts</p>\r\n									</ul>', '                 <h6 style=\"color:#982121;font-size: 17px;text-align:center\">Software License Compliance and Optimization \r\n</h6>', '               <span style=\"color:#c70000\">D</span><span style=\"color:#222222\">igito</span><span style=\"color:#c70000\">W</span><span style=\"color:#222222\">ork</span> Software License Management', '           <p>We pick up where other technologies leave off. The service has endless options to optimize the software you use, finding great efficiency and cost savings across personal devices, cloud and data center. With strong process we let you analyze and report software compliance metrics.\r\n\r\n                                               </p>\r\n                                               <ul class=\"list-style-four\">\r\n                                                   <li>Inform stakeholders</li>\r\n                                                   <p style=\"margin-left: 28px;\">Report critical information about software usage to stakeholders, to help their business decisions.</p>\r\n                                                   <li>Simulate servers</li>\r\n                                                   <p style=\"margin-left: 28px;\">Experiment with efficient choices across cloud platforms, virtual machines, and on-premises systems.</p>\r\n                                                   <li>Forecast costs</li>\r\n                                                   <p style=\"margin-left: 28px;\">Look at your future needs and budget by analyzing your license history and software trends.</p>\r\n                                               </ul>', '                 <h6>Optimize what you have today</h6>', '                  <p>The platform analyzes endless options to find great cost savings and efficiency across all your licenses. It keeps a constant eye on the cost-benefit analysis, especially for server management and dynamic data centers.\r\n</p>', '                 \r\n                                        	    <li>Do a deep strategic analysis</li>\r\n                                        	    <p style=\"margin-left: 28px;\">Review technical servers, virtualization layers, and hardware properties to identify the minimum license needs.</p>\r\n                                        	   <li>Get one-click saving potential</li>\r\n                                        	   <p style=\"margin-left: 28px;\">Look at what different license models will cost, and see what\'s available in your license pool.</p>\r\n                                        	   <li>Stop expensive installations</li>\r\n                                        	   <p style=\"margin-left: 28px;\">Compare the license costs of a specific installation to the average cost of installations.</p>', 'lice1.png', 'lice3.png', 'lice4.png', '');

